 $("#innerhtml2").html('<h2>Exile during and after the Spanish Civil War (1936-1939)</h2><br>Exile happened in three waves. The first one was during the Northern Campaign (March–November 1937), followed by a second wave after the fall of Catalonia (January–February 1939). Around 500,000 Spaniards moved to France in the first two waves. The French authorities had to improvise concentration camps, with such hard conditions that almost 350,000 of the exiled Spaniards returned. The third wave occurred after the War, at the end of March 1939, when thousands of Republicans tried to board ships to exile, although few succeeded. <br><br>After the Second World War, around 150,000 Spanish refugees lived in France, and were granted political refugee status through the Central Office for Spanish Refugees (OCRE), created in 1945 and integrated, from 1952, into the French Office for the Protection of Refugees and Stateless Persons (OFPRA).<br><br>Exile in the UK can be defined as a "minority exile" of some 4300 - 4500 people. But it is true that, at the beginning of World War II, several key figures of the Spanish Republic and the Civil War were in England, such as Dr. Negrín, Colonel Casado, Casares Quiroga, D. Pablo de Azcárate or José Castillejo; and that various arrangements were made to take President Azaña, Antonio Machado and Largo Caballero to England.<br><br>Spanish Republican exile in Mexico. It is estimated that the North American country took in between 25,000 and 30,000 Spanish refugees between 1939 and 1942, on the initiative of President Lázaro Cárdenas. Spanish refugees in Mexico were characterised as a "select group of high level", heterogeneous and with an abundance of artists, professors and professionals, although it is estimated that this type of "intellectual" or "elite" immigration made up approximately 25 per cent of the total (some 5500).<br><br>In the last months of 1939 and until mid-1940, some 4,000 Spanish Republican exiles arrived in the Dominican Republic. This group, although not very numerous, left an indelible mark on Dominican society.<br>');
