 $("#innerhtml2").html('<h2>Second wave of Czech migration to Croatia (1873-1914)</h2><br>Immigration from the Czech territories was accelerated by the gradual disarmament of the Military Frontier (1871) and its unification with Civil Croatia (1881), as well as the construction of railways in the late 19th and early 20th centuries. The second wave of immigrants, i.e. the migration of Czechs and mostly Moravians (farmers), started around 1878. Most of them came to the area of Bjelovar-Križevačka and Požega counties, travelling either by wagons or first by train and then on foot or by wagons with all their belongings. Craftsmen and their assistants (mostly Czechs) often travelled on foot, touring the country and perfecting their craft. The new settlers were wealthier, so they brought furniture and tools with them, bought land and got to know new agricultural crops (maize). In addition to cultivating the land, many were engaged in a certain craft and thus made everything they needed themselves. They settled near larger towns, in settlements where their compatriots already lived or where land was cheap, in existing indigenous villages. They did not create new Czech settlements and therefore assimilated very quickly. Some of the settlers were Czech soldiers who had sold their property in Czechia to buy as much land as possible in Croatia. All of this was caused by big changes that occurred in lifestyle and economic conditions after the unification of Croatia: border guards lost their privileges, their cooperatives disintegrated, manors collapsed, and there was a lot of uncultivated cheap land. Czech immigrants accelerated the transformation of the livestock region into arable land. Along with a new agricultural crop, potatoes, they brought with them manually-operated agricultural machines as well as machinery powered by horse and steam: wood chippers, harrows, grain cleaners, threshers, harvesters and plows. The first tractors were also owned by Czechs. Newer immigrants were also more nationally conscious, and, due to the Austro-Hungarian settlement (1867), they had to keep their Czech citizenship. As such, many returned to Czechia after 1945.<br><br>The largest and final wave of Czech immigrants loses momentum after 1900 and comes down to the immigration of individual families. One could argue that the Czech minority in Croatia was actually formed with the final wave.<br>');
